  the affinity parameter is pIC50.  Used in conjunction with the affinity slot.","    is_a: association slot","    range: AffinityParameterEnum","","  FDA adverse event level:","    description: \u003e-","    is_a: association slot","    range: FDAIDAAdverseEventEnum","","  highest FDA approval status:","    description: \u003e-","      Should be the highest level of FDA approval this chemical entity or device has, regardless of which","      disease, condition or phenotype it is currently being reviewed to treat.  For specific levels of FDA","      approval for a specific condition, disease, phenotype, etc., see the association slot, 'clinical approval status.'","    range: ApprovalStatusEnum","","  drug regulatory status world wide:","    aliases: ['max phase']","    range: ApprovalStatusEnum","    description: \u003e-","      An agglomeration of drug regulatory status worldwide. Not specific to FDA.","    exact_mappings:","      - NCIT:C172573","    narrow_mappings:","      - NCIT:R172","      - NCIT:regimen_has_accepted_use_for_disease","       # RTX mapped REPODB terms","      - REPODB:clinically_tested_approved_unknown_phase","      - REPODB:clinically_tested_suspended_phase_0","      - REPODB:clinically_tested_suspended_phase_1","      - REPODB:clinically_tested_suspended_phase_1_or_phase_2","      - REPODB:clinically_tested_suspended_phase_2","      - REPODB:clinically_tested_suspended_phase_2_or_phase_3","      - REPODB:clinically_tested_suspended_phase_3","      - REPODB:clinically_tested_terminated_phase_0","      - REPODB:clinically_tested_terminated_phase_1","      - REPODB:clinically_tested_terminated_phase_1_or_phase_2","      - REPODB:clinically_tested_terminated_phase_2","      - REPODB:clinically_tested_terminated_phase_2_or_phase_3","      - REPODB:clinically_tested_terminated_phase_3","      - REPODB:clinically_tested_withdrawn_phase_0","      - REPODB:clinically_tested_withdrawn_phase_1","      - REPODB:clinically_tested_withdrawn_phase_1_or_phase_2","      - REPODB:clinically_tested_withdrawn_phase_2","      - REPODB:clinically_tested_withdrawn_phase_2_or_phase_3","      - REPODB:clinically_tested_withdrawn_phase_3","","  routes of delivery:","    description: \u003e-","      the method or process of administering a pharmaceutical compound to achieve a therapeutic","      effect in humans or animals.","    multivalued: true","    range: DrugDeliveryEnum","","   ## -------------------","   ## QUALIFIERS","   ## -------------------","","  form or variant qualifier:","    is_a: qualifier","    abstract: true","    description: \u003e-","      A qualifier that composes with a core subject/object concept to define a specific type, variant,","      alternative version of this concept. The composed concept remains a subtype or instance of the core concept.","      For example, the qualifier ‘mutation’ combines with the core concept ‘Gene X’ to express the compose concept","      ‘a mutation of Gene X’.","    examples:","      - value: mutation","      - value: late stage","      - value: severe","      - value: transplant","      - value: chemical analog","    notes: \u003e-","      please see the ChemicalOrGeneOrGeneProductFormOrVariantEnum (below) for examples of 'form or variant qualifier'","      terms in the gene-\u003echemical association space.","      the qualifier ‘mutation’ combines with the core concept ‘Gene X’ to express the compose concept ‘Mutated forms of Gene X’.","      the qualifier ‘late stage’ combines with a core concept of ‘Disease X’ to express the  more specific concept ‘Late Stage forms of Disease X’","      the qualifier ‘recombinant’ combines with a core concept of ‘FLT1 Gene’ to express the composed concept ‘Recombinant forms of the FLT1 gene’","      the qualifier ‘chemical analog’ combines with a core concept of ‘Ditiocarb’ to express the composed concept ‘analog forms of Ditiocarb’","    in_subset:","      - translator_minimal","","  specialization qualifier:","    is_a: qualifier","    abstract: true","    description: \u003e-","      A qualifier that composes with a core subject/object concept to define a more specific version of the","      subject concept, specifically using an ontology term that is not a subclass or descendant of the core concept","      and in the vast majority of cases, is of a different ontological namespace than the category or namespace of the","      subject identifier.","    examples:","      - value: CHEBI:5118  # fluoxetine","        description: \u003e-","          In a MAXO annotation this would be a specialization in treatment of a disease. For example,","          fluoxetine would be a specialization of the MAXO term 'serotonin-norepinephrine reuptake inhibitor agent","          therapy' as a treatment for the HP term 'Fatigable muscle weakness' in the context of the MONDO term","          'congenital myasthenic syndrome '4A.'","      - value: GO:0005634  # nucleus","        description: \u003e-","          In an expression annotation this would be a specialization in location of an anatomical entity. For example,","          \"expression in the nucleus of hepatic cells\" would be a specialization of \"expression in hepatic cells\"","","  aspect qualifier:","    is_a: qualifier","    abstract: true","    description: \u003e-","      Composes with the core concept to describe new concepts of a different ontological type. e.g. a process in which","      the core concept participates, a function/activity/role held by the core concept, or a characteristic/quality that","      inheres in the core concept.  The purpose of the aspect slot is to indicate what aspect is being affected in an","      'affects' association.","    examples:","      - value: stability","      - value: abundance","      - value: expression","      - value: exposure","    notes: \u003e-","      for good examples of aspects in the gene-\u003e chemical space, please see the","      GeneOrGeneProductOrChemicalEntityAspectEnum (below) which lists many aspects that can be used to qualify","      the gene making the full subject a different ontological type.","      the qualifier ‘expression’ combines with a core concept of ‘Gene X’ to express the composed concept ‘expression of Gene X’ (Gene → Biological Process)","      the qualifier ‘exposure’ combines with a core concept of ‘Chemical X’ to express the composed concept ‘exposure to Chemical X’ (Chemical → Exposure Process)","      the qualifier ‘activity’ combines with a core concept of ‘PPARG’ to express the concept ‘activity of PPARG’ (Gene → function/activity)","      the qualifier ‘emergency Department Visit’ combines with a core concept of ‘Disease X’ to express the concept ‘Emergency Department visits for Disease X’ (Disease → Clinical Event)","      the qualifier ‘infection’ combines with a core concept of ‘Giardia’ to express the concept ‘Infection with Giardia’ (Taxon → Biological / Pathological Process)","      the qualifier ‘severity’ combines with a core concept of ‘DILI’ to express the concept ‘the severity level of DILI’ (Disease → (intrinsic) Characteristic/Quality)","      the qualifier ‘abundance’ combines with a core concept of ‘BRCA2’ to express the concept ‘abundance of BRCA2’ (Gene → (extrinsic) characteristic/quality)","    in_subset:","      - translator_minimal","","  derivative qualifier:","    is_a: qualifier","    abstract: true","    description: \u003e-","      A qualifier that composes with a core subject/object  concept to describe something that is derived from the","      core concept.  For example, the qualifier ‘metabolite’ combines with a ‘Chemical X’ core concept to express","      the composed concept ‘a metabolite of Chemical X’.","    examples:","      - value: metabolite","    in_subset:","      - translator_minimal","","  part qualifier:","    is_a: qualifier","    abstract: true","    description: \u003e-","      defines a specific part/component of the core concept (used in cases there this specific part has no IRI we can","      use to directly represent it, e.g. 'ESR1 transcript' q: polyA tail).","    examples:","      - value: polyA tail","      - value: upstream control region","    in_subset:","      - translator_minimal","","  context qualifier:","    is_a: qualifier","    abstract: true","    description: \u003e-","      Restricts the setting/context/location where the core concept (or qualified core concept) resides or occurs.","    examples:","      - value: cohort x (e.g. a specific population, referenced by an identifier)","      - value: gut microbiome  # OHMI:0000020","    in_subset:","      - translator_minimal","","  direction qualifier:","    is_a: qualifier","    abstract: true","    description: \u003e-","      Composes with the core concept (+ aspect if provided) to describe a change in its direction or degree.","    notes: \u003e-","      the qualifier ‘increased’ combines with a core concept of ‘Gene X’ and an aspect of ‘expression’ to express the composed concept ‘increased expression of Gene X’","      the qualifier ‘decreased’ combines with a core concept of ‘Protein X’ and an aspect of ‘abundance’ to express the composed concept ‘decreased abundance of Protein X’","    in_subset:","      - translator_minimal","","  mapped predicate:","    description: \u003e-","      The predicate that is being replaced by the fully qualified representation of predicate + subject and object","      qualifiers.  Only to be used in test data and mapping data to help with the transition to the fully qualified","      predicate model. Not to be used in knowledge graphs.","","  predicate mappings:","    description: \u003e-","      A collection of relationships that are not used in biolink, but have biolink patterns that can","      be used to replace them.  This is a temporary slot to help with the transition to the fully qualified predicate","      model in Biolink3.","    multivalued: true","    range: predicate mapping","    inlined_as_list: true","","  exact matches:","    description: \u003e-","      A list of terms from different schemas or terminology systems that have","      an identical meaning. Such terms often describe the same concept from","      different ontological perspectives.","    multivalued: true","","  narrow matches:","    description: \u003e-","      A list of terms from different schemas or terminology systems that have","      a narrower meaning. Such terms often describe a more specific concept","      from different ontological perspectives.","    multivalued: true","","  broad matches:","    description: \u003e-","      A list of terms from different schemas or terminology systems that have","      a broader meaning. Such terms often describe a more general concept","      from different ontological perspectives.","    multivalued: true","","  subject aspect qualifier:","    description: \u003e-","      Composes with the core concept to describe new concepts of a different ontological type. e.g. a process in which","      the core concept participates, a function/activity/role held by the core concept, or a characteristic/quality that","      inheres in the core concept.  The purpose of the aspect slot is to indicate what aspect is being affected in an","      'affects' association.  This qualifier specifies a change in the subject of an association (aka: statement).","    examples:","      - value: stability","      - value: abundance","      - value: expression","      - value: exposure","    is_a: aspect qualifier","    in_subset:","      - translator_minimal","","  subject specialization qualifier:","    is_a: specialization qualifier","    description: \u003e-","      A qualifier that composes with a core subject/object concept to define a more specific version of the","      subject concept, specifically using an ontology term that is not a subclass or descendant of the core concept","      and in the vast majority of cases, is of a different ontological namespace than the category or namespace of the","      subject identifier.","    in_subset:","      - translator_minimal","    range: uriorcurie","","  subject form or variant qualifier:","    description: \u003e-","      A qualifier that composes with a core subject/object concept to define a specific type, variant,","      alternative version of this concept. The composed concept remains a subtype or instance of the core concept.","      For example, the qualifier ‘mutation’ combines with the core concept ‘Gene X’ to express the compose concept","      ‘a mutation of Gene X’.  This qualifier specifies a change in the subject of an association (aka: statement).","    examples:","      - value: mutation","      - value: late stage","      - value: severe","      - value: transplant","      - value: chemical analog","    is_a: form or variant qualifier","    in_subset:","      - translator_minimal","","  subject part qualifier:","    description: \u003e-","      defines a specific part/component of the core concept (used in cases there this specific part has no IRI we can","      use to directly represent it, e.g. 'ESR1 transcript' q: polyA tail).  This qualifier is for the","      subject of an association (or statement).","    is_a: part qualifier","    in_subset:","      - translator_minimal","","  subject derivative qualifier:","    description: \u003e-","      A qualifier that composes with a core subject/object  concept to describe something that is derived from the","      core concept.  For example, the qualifier ‘metabolite’ combines with a ‘Chemical X’ core concept to express","      the composed concept ‘a metabolite of Chemical X’.  This qualifier is for the subject of an association","      (or statement).","    examples:","      - value: metabolite","    is_a: derivative qualifier","    in_subset:","      - translator_minimal","","  subject context qualifier:","    is_a: context qualifier","    in_subset:","      - translator_minimal","","  subject direction qualifier:","    description: \u003e-","      Composes with the core concept (+ aspect if provided) to describe a change in its direction or degree.","      This qualifier qualifies the subject of an association (aka: statement).","    is_a: direction qualifier","    range: DirectionQualifierEnum","    in_subset:","      - translator_minimal","","  object aspect qualifier:","    description: \u003e-","      Composes with the core concept to describe new concepts of a different ontological type. e.g. a process in which","      the core concept participates, a function/activity/role held by the core concept, or a characteristic/quality that","      inheres in the core concept.  The purpose of the aspect slot is to indicate what aspect is being affected in an","      'affects' association.  This qualifier specifies a change in the object of an association (aka: statement).","    examples:","      - value: stability","      - value: abundance","      - value: expression","      - value: exposure","    is_a: aspect qualifier","    in_subset:","      - translator_minimal","","  object specialization qualifier:","    is_a: specialization qualifier","    description: \u003e-","      A qualifier that composes with a core subject/object concept to define a more specific version of the","      subject concept, specifically using an ontology term that is not a subclass or descendant of the core concept","      and in the vast majority of cases, is of a different ontological namespace than the category or namespace of the","      subject identifier.","    in_subset:","      - translator_minimal","    range: uriorcurie","","  object form or variant qualifier:","    description: \u003e-","      A qualifier that composes with a core subject/object concept to define a specific type, variant,","      alternative version of this concept. The composed concept remains a subtype or instance of the core concept.","      For example, the qualifier ‘mutation’ combines with the core concept ‘Gene X’ to express the compose concept","      ‘a mutation of Gene X’.  This qualifier specifies a change in the object of an association (aka: statement).","    examples:","      - value: mutation","      - value: late stage","      - value: severe","      - value: transplant","      - value: chemical analog","    is_a: form or variant qualifier","    in_subset:","      - translator_minimal","","  object part qualifier:","    description: \u003e-","      defines a specific part/component of the core concept (used in cases there this specific part has no IRI we can","      use to directly represent it, e.g. 'ESR1 transcript' q: polyA tail).  This qualifier is for the","      object of an association (or statement).","    is_a: part qualifier","    in_subset:","      - translator_minimal","","  object derivative qualifier:","    description: \u003e-","      A qualifier that composes with a core subject/object  concept to describe something that is derived from the","      core concept.  For example, the qualifier ‘metabolite’ combines with a ‘Chemical X’ core concept to express","      the composed concept ‘a metabolite of Chemical X’.  This qualifier is for the object of an association","      (or statement).","    examples:","      - value: metabolite","    is_a: derivative qualifier","    in_subset:","      - translator_minimal","","  object context qualifier:","    is_a: context qualifier","    in_subset:","      - translator_minimal","","  object direction qualifier:","    description: \u003e-","      Composes with the core concept (+ aspect if provided) to describe a change in its direction or degree.","      This qualifier qualifies the object of an association (aka: statement).","    is_a: direction qualifier","    range: DirectionQualifierEnum","    in_subset:","      - translator_minimal","","  qualified predicate:","    is_a: qualifier","    description: \u003e-","      Predicate to be used in an association when subject and object qualifiers are present and the full","      reading of the statement requires a qualification to the predicate in use in order to refine or","      increase the specificity of the full statement reading.  This qualifier holds a relationship to be used instead of that","      expressed by the primary predicate, in a ‘full statement’ reading of the association, where qualifier-based","      semantics are included.  This is necessary only in cases where the primary predicate does not work in a","      full statement reading.","    notes: \u003e-","      to express the statement that “Chemical X causes increased expression of Gene Y”, the core triple is read","      using the fields subject:ChemX, predicate:affects, object:GeneY . . . and the full statement is read using","      the fields subject:ChemX, qualified_predicate:causes, object:GeneY, object_aspect: expression,","      object_direction:increased. The predicate ‘affects’ is needed for the core triple reading, but does not make","      sense in the full statement reading  (because “Chemical X affects increased expression of Gene Y'' is not","      what we mean to say here: it causes increased expression of Gene Y)","","  statement qualifier:","    is_a: qualifier","    description: \u003e-","      A property that qualifies the entirety of the statement made in an association.  It applies to both","      a fully qualified subject and a fully qualified object as well as the predicate and qualified predicate","      in an association.","    in_subset:","      - translator_minimal","","  causal mechanism qualifier:","    is_a: statement qualifier","    description: \u003e-","      A statement qualifier representing a type of molecular control mechanism through which an","      effect of a chemical on a gene or gene product is mediated (e.g. 'agonism', 'inhibition',","      'allosteric modulation', 'channel blocker')","    range: CausalMechanismQualifierEnum","    in_subset:","      - translator_minimal","","  anatomical context qualifier:","    is_a: statement qualifier","    description: \u003e-","      A statement qualifier representing an anatomical location where an relationship expressed in an","      association took place (can be a tissue, cell type, or sub-cellular location).","    notes: \u003e-","      Anatomical context values can be any term from UBERON. For example, the context qualifier ‘cerebral cortext’","      combines with a core concept of ‘neuron’","      to express the composed concept ‘neuron in the cerebral cortext’. The species_context_qualifier applies","      taxonomic context, e.g. species-specific molecular activity.  Ontology CURIEs are expected as values","      here, the examples below are intended to help clarify the content of the CURIEs.","    examples:","      - value: blood  # UBERON:0000178","      - value: cerebral cortext  # UBERON:0000956","    in_subset:","      - translator_minimal","","  species context qualifier:","    is_a: statement qualifier","    description: \u003e-","      A statement qualifier representing a taxonomic category of species in which a relationship","      expressed in an association took place.","    range: organism taxon","    examples:","      - value: zebrafish  # NCBITaxon:7955","      - value: human  # NCBITaxon:9606","    notes:","      - Ontology CURIEs are expected as values here, the examples below are intended to help clarify the content of the CURIEs.","    in_subset:","      - translator_minimal","","  disease context qualifier:","    is_a: context qualifier","    description: \u003e-","        A context qualifier representing a disease or condition in which a relationship expressed in an association took place.","    range: disease","    examples:","      - value: MONDO:0004979  # Asthma","      - value: MONDO:0005148  # type 2 diabetes mellitus","    in_subset:","      - translator_minimal","","  qualifiers:","    deprecated: true","    description: \u003e-","      connects an association to qualifiers that modify or","      qualify the meaning of that association","    local_names:","      ga4gh: annotation qualifier","    is_a: association slot","    multivalued: true","    range: ontology class","","  frequency qualifier:","    is_a: qualifier","    description: \u003e-","      a qualifier used in a phenotypic association to state how frequent the phenotype is observed in the subject","    range: frequency value","    in_subset:","      - translator_minimal","","  severity qualifier:","    deprecated: true","    description: \u003e-","      a qualifier used in a phenotypic association to state","      how severe the phenotype is in the subject","    is_a: qualifier","    range: severity value","    in_subset:","      - translator_minimal","","  sex qualifier:","    description: \u003e-","      a qualifier used in a phenotypic association to state whether","      the association is specific to a particular sex.","    is_a: qualifier","    range: biological sex","    in_subset:","      - translator_minimal","","  onset qualifier:","    description: \u003e-","      a qualifier used in a phenotypic association to state","      when the phenotype appears is in the subject.","    notes: \u003e-","      This  is in Biolink to support HP ontology annotations which use \"onset\" (with terms from HP)","      as an annotation on a disease to phenotypic feature association.  Please only use it for this","      purpose.  If the intent is to describe the onset of a disease in the context of a treatment,","      use object_aspect_qualifier and object_direction_qualifier to capture \"delayed onset\" or \"exacerbated onset\"","      slot.","    is_a: qualifier","    range: onset","    in_subset:","      - translator_minimal","","  clinical modifier qualifier:","    description: \u003e-","      the method or process of administering a pharmaceutical compound to achieve a therapeutic","      effect in humans or animals.","    is_a: association slot","    range: clinical modifier","","  sequence variant qualifier:","    descrip