verse of 'biolink:treats'","      - MONDO:disease_responds_to","    narrow_mappings:","      # \"is treated by substance\" constrains statements to","      # subset of the universe of all possible treatments","      - RO:0002302","","  studied to treat:","    is_a: related to at instance level","    description: \u003e-","      Holds between an  substance, procedure, or activity and a medical condition, and reports that one or more","      scientific study has been performed to specifically test the potential of the  substance, procedure, or","      activity to treat the medical condition  (i.e. to ameliorate, stabilize, or cure the condition, or to delay,","      prevent, or reduce the risk of it manifesting in the first place).","    notes: \u003e-","      Predicates in this hierarchy are used in practice when a source reports performance of a study, but there is","      not sufficient evidence or demonstrated efficacy against the condition to warrant creating a ‘treats’ assertion","      edge. Note however that a 'studied to treat' edge may be used as evidence to support creation of a separate","      'treats' prediction edge.","    domain: chemical or drug or treatment","    range: disease or phenotypic feature","    mixins:","      - treats or applied or studied to treat","    annotations:","      canonical_predicate: true","","  in clinical trials for:","    is_a: studied to treat","    description: \u003e-","      Holds between an intervention and a medical condition, and reports that a clinical trial  is being or has been","      performed in human patients to test the potential of the intervention to treat the medical condition","      (e.g. to ameliorate, stabilize, or cure the condition, or to delay, prevent, or reduce the risk of it","      manifesting in the first place).","    notes: \u003e-","      This predicate should be used when a source reports a clinical trial where the intervention is being or was","      interrogated, regardless of the phase o