     connects an association to a qualitative term denoting the level of confidence","","  has confidence score:","    is_a: association slot","    range: float","    description: \u003e-","      connects an association to a quantitative (numeric) value that can be interpreted","      as an indicator of the degree of confidence that a piece of information is true,","      and accurately reflects the aspect of reality it is about.","    exact_mappings:","      - SEPIO:0000168","    close_mappings:","      - SEPIO:0000187","      - SEPIO:0000167","","  has evidence:","    is_a: association slot","    range: evidence type","    description: \u003e-","      connects an association to an instance of supporting evidence","    exact_mappings:","      - RO:0002558","    multivalued: true","","  has supporting study result:","    range: study result","    multivalued: true","    is_a: association slot","    description: \u003e-","      connects an association to an instance of supporting study result","","  log odds ratio:","    is_a: association slot","    description: \u003e-","      The logarithm of the odds ratio, or the ratio of the odds of event Y occurring in an exposed group versus the","      odds of event Y occurring in a non-exposed group has","    range: float","","  log odds ratio 95 ci:","    is_a: association slot","    description: \u003e-","      The ninety-five percent confidence range in which the true log odds ratio for the sample population falls.","    range: float","","  total sample size:","    is_a: dataset count","    description: \u003e-","      The total number of patients or participants within a sample population.","    range: integer","","","  mechanism of action:","    is_a: association slot","    range: boolean","    description: \u003e-","      a boolean flag to indicate if the edge is part of a path or subgraph of a knowledge graph that constitutes","      the mechanism of action for a result.","    exact_mappings:","      - NCIT:C54680","      - MI:2044","      - LOINC:MTHU019741","","  knowledge source:","    is_a: association slot","    description: \u003e-","      An Information Resource from which the knowledge expressed in an Association was","      retrieved, directly or indirectly. This can be any resource through which the","      knowledge passed on its way to its currently serialized form. In practice,","      implementers should use one of the more specific subtypes of this generic property.","    close_mappings:","      - pav:providedBy","","  provided by:","    is_a: node property","    description: \u003e-","      The value in this node property represents the knowledge provider that created or assembled the","      node and all of its attributes.  Used internally to represent how a particular node made its way into a","      knowledge provider or graph.","    multivalued: true","","  primary knowledge source:","    is_a: knowledge source","    description: \u003e-","      The most upstream source of the knowledge expressed in an Association that an","      implementer can identify.  Performing a rigorous analysis of upstream data providers is expected; every effort","      is made to catalog the most upstream source of data in this property.  Only one data source should be declared","      primary in any association.  \"aggregator knowledge source\" can be used to capture non-primary sources.","    notes: \u003e-","      For example: a single ChemicalToGene Edge originally curated by ClinicalTrials.org, is aggregated by ChEMBL, then","      incorporated into the MolePro KP, then sent via TRAPI message to the ARAGORN ARA, and finally sent to","      the NCATS ARS. The retrieval path for this Edge is as follows:","      ARS--retrieved_from--\u003e  ARAGORN  --retrieved_from--\u003e   MolePro  --retrieved_from--\u003e ChEMBL --retrieved_from--\u003e  ClinicalTrials.gov","      The \"primary knowledge source\" for this edge is \"infores:clinical-trials-gov\".  \"infores:chembl\" and \"infores:molecular_data_provider\"","      are listed in the \"aggregator knowledge source\" property.","    multivalued: false","","  aggregator knowledge source:","    is_a: knowledge source","    description: \u003e-","      An intermediate aggregator resource from which knowledge expressed in an Association was","      retrieved downstream of the original source, on its path to its current serialized form.","    multivalued: true","    notes: \u003e-","      For example, in this Feature Variable Association Edge generated by the Exposure Agent’s ICEES KP,","      through statistical analysis of clinical and environmental data supplied by the UNC Clinical Data Warehouse,","      the Edge is passed to the Ranking Agent’s ARAGORN ARA,","      and then on to the ARS. The retrieval path for this Edge is as follows:","      ARS--retrieved_from--\u003e  ARAGORN  --retrieved_from--\u003e   ICEES --supporting_data_from--\u003e  UNC Data Warehouse","      This example illustrates how to represent the source provenance of KP-generated knowledge, including the source of","      data from which the knowledge was derived.","      The \"primary knowledge source\" for this edge is \"infores:icees-asthma\". A \"supporting data source\" for this KP-","      generated knowledge is \"infores:unc-cdw-health.\"  The \"aggregator knowledge source\" for this data is \"infores:aragorn-ara\"","","  supporting data source:","    is_a: association slot","    description: \u003e-","      An Information Resource from which data was retrieved and subsequently used as","      evidence to generate the knowledge expressed in an Association (e.g. through","      computation on, reasoning or inference over the retrieved data).","    multivalued: true","    notes: \u003e-","      For example, in this Feature Variable Association Edge generated by the Exposure Agent’s ICEES KP,","      through statistical analysis of clinical and environmental data supplied by the UNC Clinical Data Warehouse,","      the Edge is passed to the Ranking Agent’s ARAGORN ARA,","      and then on to the ARS. The retrieval path for this Edge is as follows:","      ARS--retrieved_from--\u003e  ARAGORN  --retrieved_from--\u003e   ICEES --supporting_data_from--\u003e  UNC Data Warehouse","      This example illustrates how to represent the source provenance of KP-generated knowledge, including the source of","      data from which the knowledge was derived.","      The \"primary knowledge source\" for this edge is \"infores:icees-asthma\". A \"supporting data source\" for this KP-","      generated knowledge is \"infores:unc-cdw-health.\"  The \"aggregator knowledge source\" for this data is \"infores:aragorn-ara\"","","  supporting data set:","    is_a: association slot","    description: \u003e-","      A set of data used as evidence to generate the knowledge expressed in an Association (e.g. through","      computation on, reasoning or inference over the retrieved data).","    multivalued: true","","  chi squared statistic:","    is_a: association slot","    range: float","    description: \u003e-","      represents the chi-squared statistic computed from observations","    exact_mappings:","      - STATO:0000030","","  z score:","    aliases: ['z-score', 'z-value', 'standard score', 'normal score']","    is_a: association slot","    range: float","    description: \u003e-","      A measure of the divergence of an individual experimental result from","      the most probable result, the mean. Z is expressed in terms of the number","      of standard deviations from the mean value.","    exact_mappings:","      - STATO:0000104","      - NCIT:C68741","      - EDAM-DATA:1668","","  p value:","    aliases: ['unadjusted p value']","    is_a: association slot","    range: float","    description: \u003e-","      A quantitative confidence value that represents the probability of","      obtaining a result at least as extreme as that actually obtained,","      assuming that the actual value was the result of chance alone.","    exact_mappings:","      - OBI:0000175","      - NCIT:C44185","      - EDAM-DATA:1669","","  evidence count:","    is_a: association slot","    description: \u003e-","      The number of evidence instances that are connected to an association.","    range: integer","","  dataset count:","    is_a: association slot","    description: \u003e-","      The total number of instances (e.g., number of patients, number of rows, etc) in a dataset/cohort.","    range: integer","    examples:","      - value: 100000","","  concept count subject:","    is_a: association slot","    description: \u003e-","      The number of instances in a dataset/cohort whose records contain","      the concept in the subject slot of an association.","    range: integer","    examples:","      - value: 489","","  concept count object:","    is_a: association slot","    description: \u003e-","      The number of instances in a dataset/cohort whose records contain","      the concept in the object slot of an association.","    range: integer","","  concept pair count:","    is_a: association slot","    description: \u003e-","      The number of instances in a dataset/cohort whose records contain","      both the subject and object concept of an association.","    range: integer","    examples:","      - value: 1731","","  expected count:","    is_a: association slot","    description: \u003e-","      The expected (calculated) number of instances in a dataset/cohort whose records contain both the subject and","      object concept of an association if the subject and object concepts are independent.","","  relative frequency subject:","    is_a: association slot","    description: \u003e-","      The frequency at which subject and object concepts co-occur in","      records within a dataset/cohort, relative to the frequency at which the subject","      concept appears in these same records.","    range: float","    examples:","      - value: 0.01840490798","","  relative frequency object:","    is_a: association slot","    description: \u003e-","      The frequency at which subject and object concepts co-occur in","      records within a dataset/cohort, relative to the frequency at which the object","      concept appears in these same records.","    range: string","","  relative frequency subject confidence interval:","    is_a: association slot","    description: \u003e-","      The 99% confidence interval for the relative_frequency_subject calculation","      (i.e. the range of values within which the true value has a 99% chance of falling)","    range: string","","  relative frequency object confidence interval:","    is_a: association slot","    description: \u003e-","      The 99% confidence interval for the relative_frequency_object calculation","      (i.e. the range of values within which the true value has a 99% chance of falling)","    range: string","","  adjusted p value:","    is_a: p value","    description: \u003e-","      The adjusted p-value is the probability of obtaining test results","      at least as extreme as the results actually observed, under the assumption that","      the null hypothesis is correct, adjusted for multiple comparisons.","      P is always italicized and capitalized. The actual P value* should be expressed (P=. 04)","      rather than expressing a statement of inequality (P\u003c. 05), unless P\u003c.","    range: float","","  bonferonni adjusted p value:","    is_a: adjusted p value","    description: \u003e-","      The Bonferroni correction is an adjustment made to P values when several dependent or independent","      statistical tests are being performed simultaneously on a single data set. To perform a Bonferroni","      correction, divide the critical P value (α) by the number of comparisons being made.  P is always italicized and","      capitalized. The actual P value* should be expressed (P=. 04) rather than expressing a statement of inequality","      (P\u003c. 05), unless P\u003c.","    range: float","    examples:","      - value: 0.018","","  supporting text:","    is_a: association slot","    description: The segment of text from a document that supports the mined assertion.","    multivalued: true","    range: string","    examples:","      - value: The administration of 50g/ml bupivacaine promoted maximum breast cancer.","","  supporting documents:","    deprecated: true","    is_a: association slot","    description: \u003e-","      One or more referenceable documents that report the statement expressed in an Association, or provide","      information used as evidence supporting this statement.","    range: uriorcurie","    multivalued: true","    examples:","      - value: PMID:12345678","","  subject location in text:","    is_a: association slot","    description: \u003e-","      Character offsets for the text span(s) in the supporting text corresponding","      to the subject concept of the extracted assertion.","    range: integer","    examples:","      - value: 15","    multivalued: true","","  object location in text:","    is_a: association slot","    description: \u003e-","      Character offsets for the text span(s) in the supporting text corresponding","      to the object concept of the extracted assertion","    range: integer","    examples:","      - value: 15","    multivalued: true","","  extraction confidence score:","    is_a: association slot","    description: \u003e-","      A quantitative confidence value that represents the probability of","      obtaining a result at least as extreme as that actually obtained,","      assuming that the actual value was the result of chance alone.","    range: integer","    examples:","      - value: 15","","  supporting document type:","    is_a: association slot","    description: \u003e-","      The document type (e.g., Journal Article, Case Study, Preprint) for","      the supporting document used in a Text Mining Result.","    range: string","    examples:","      - value: Journal Article","","  supporting document year:","    is_a: association slot","    description: \u003e-","      The document year (typically the publication year) for the supporting","      document used in a Text Mining Result.","    range: integer","    examples:","      - value: 1999","","  supporting text section type:","    is_a: association slot","    description: \u003e-","      The section of the supporting text of a Text Mining Result within","      the supporting document. This is in the form of the name of the document section","      (e.g., Abstract, Introduction) that contains the supporting text.","    range: string","    examples:","      - value: Introduction","","  ln ratio:","    is_a: association slot","    description: the natural log of the ratio of co-occurrence to expected","    range: float","    examples:","      - value: 2.922827136","","  ln ratio confidence interval:","    is_a: association slot","    description: \u003e-","      The 99% confidence interval for the ln_ratio calculation","      (i.e. the range of values within which the true value has a 99% chance of falling)","    range: float","    examples:","      - value: 2.922827136","","  interacting molecules category:","    is_a: association slot","    range: ontology class","    exact_mappings:","      - MI:1046","    values_from:","      - MI","    examples:","      - value: MI:1048","        description: smallmolecule-protein","","  expression site:","    description: \u003e-","      location in which gene or protein expression takes place.","      May be cell, tissue, or organ.","    is_a: association slot","    range: anatomical entity","    examples:","      - value: UBERON:0002037","        description: cerebellum","","  phenotypic state:","    description: \u003e-","      in experiments (e.g. gene expression) assaying diseased or unhealthy","      tissue, the phenotypic state can be put here, e.g. MONDO ID.","      For healthy tissues, use XXX.","    is_a: association slot","    range: disease or phenotypic feature","","  allelic requirement:","    description: \u003e-","      The allele configuration of a particular gene or variant required for the","      expression of a disease or phenotype in a specific patient or instance.","    is_a: association slot","    range: string","    pattern: \"^HP:\\\\d{7}$\"","    comments: \u003e-","      This edge property may be used by associations between Genes or","      SequenceVariants and DiseaseOrPhenotypicFeatures to provide the inheritance","      pattern and genetic context of the relationship.","      Terms from the HP mode of inheritance sub-ontology (HP:0000005) should be used","      in the value of this slot. This slot differs from the predicate \"has_mode_of_inheritance\",","      in that the predicate is used to link a disease or phenotype with its general","      inheritance pattern (how it is typically transmitted from one generation to the next,","      regardless of the specific genetic variant that is present in an individual or instance).","","  publications:","    aliases: ['supporting publications', 'supporting documents']","    description: \u003e-","      One or more publications that report the statement expressed in an","      Association, or provide information used as evidence supporting this statement.","    comments: \u003e-","        The notion of a ‘Publication’ is considered broadly to include any","        document made available for public consumption. It covers journal issues,","        individual articles, and books - and also things like article pre-prints,","        white papers, patents, drug labels, web pages, protocol documents, etc.","    is_a: association slot","    multivalued: true","    range: publication","","  sources:","    aliases: ['source retrieval provenance']","    description: \u003e-","      A set of RetrievalSources, which traces where the statement expressed in an","      Association came from. For example, the provenance of a Gene-Chemical Edge","      might be traced through the Translator Resource that provided it (e.g. MolePro)","      to one or more intermediate aggregator resources (e.g. ChEMBL), and finally to","      the resource that originally created/curated it (e.g. ClinicalTrials.org).","    comments: \u003e-","      Note that source retrieval provenance concerns the mechanical retrieval and","      transformation of data between web accessible information systems. It does not","      trace the source of knowledge back to specific publications or data sets. And","      it is not concerned with the reasoning, inference or analysis activities that","      generate knowledge in the first place (this is instead covered by 'knowledge","      level' and 'agent type' properties).","    is_a: association slot","    multivalued: true","    range: retrieval source","","  associated environmental context:","    is_a: association slot","    description: \u003e-","      An attribute that can be applied to an association where the association holds between two entities","      located or occurring in a particular environment. For example, two microbial taxa may interact in the context of","      a human gut; a disease may give rise to a particular phenotype in a particular environmental exposure.","       # TODO: add examples of values for this property.","","  sequence localization attribute:","    is_a: association slot","    domain: genomic sequence localization","    description: \u003e-","      An attribute that can be applied to a genome sequence localization edge. These edges","      connect a nucleic acid entity such as an exon to an entity such as a chromosome. Edge properties are used","      to ascribe specific positional information and other metadata to the localization. In pragmatic terms","      this can be thought of as columns in a GFF3 line.","","  interbase coordinate:","    is_a: sequence localization attribute","    aliases: ['zero-based', 'half-open', 'space-based']","    description: \u003e-","      A position in interbase coordinates. Interbase coordinates start at position 0 instead of position 1.","      This is applied to a sequence localization edge.","    range: integer","","  start interbase coordinate:","    is_a: interbase coordinate","    description: \u003e-","      The position at which the subject nucleic acid entity starts","      on the chromosome or other entity to which it is located on.","      (ie: the start of the sequence being referenced is 0).","    close_mappings:","      - faldo:begin","    annotations:","      opposite_of: end interbase coordinate","","  end interbase coordinate:","    is_a: interbase coordinate","    description: \u003e-","      The position at which the subject nucleic acid entity ends","      on the chromosome or other entity to which it is located on.","    close_mappings:","      - faldo:end","    annotations:","      opposite_of: start interbase coordinate","","  start coordinate:","    is_a: base coordinate","    aliases: ['start']","    description: \u003e-","      The position at which the subject genomic entity starts","      on the chromosome or other entity to which it is located on.","      (ie: the start of the sequence being referenced is 1).","    exact_mappings:","      - gff3:start","    close_mappings:","      - faldo:begin","","  end coordinate:","    is_a: base coordinate","    aliases: ['end']","    description: \u003e-","      The position at which the subject genomic entity ends","      on the chromosome or other entity to which it is located on.","    exact_mappings:","      - gff3:end","    close_mappings:","      - faldo:end","","  genome build:","    is_a: sequence localization attribute","    description: \u003e-","      The version of the genome on which a feature is located.","      For example, GRCh38 for Homo sapiens.","    range: StrandEnum","    exact_mappings:","      - gff3:strand","","  strand:","    is_a: sequence localization attribute","    description: \u003e-","      The strand on which a feature is located. Has a value of '+'","      (sense strand or forward strand) or '-' (anti-sense strand or reverse strand).","    range: StrandEnum","    exact_mappings:","      - gff3:strand","","  phase:","    is_a: sequence localization attribute","    domain: coding sequence","    description: \u003e-","      The phase for a coding sequence entity. For example, phase of a","      CDS as represented in a GFF3 with a value of 0, 1 or 2.","    range: PhaseEnum","    exact_mappings:","      - gff3:phase","","  clinical approval status:","    is_a: association slot","    description: \u003e-","    range: ClinicalApprovalStatusEnum","","  max research phase:","    is_a: association slot","    range: ResearchPhaseEnum","","  has supporting studies:","    is_a: association slot","    range: study","    description: A study that produced information used as evidence to generate the knowledge expressed in an Association.","    multivalued: true","","  supporting study metadata:","    is_a: association slot","    description: \u003e-","      Information about a study used to generate information used as evidence to support the knowledge expressed in an","      Association. In practice, data creators should use one of the more specific subtypes of this property.","    comments:","      - This is an abstract slot that groups a set of concrete slots used to directly attach to an association information","        about a study that produced evidence used to generate the knowledge expressed in the edge.","      - Note that these concrete 'supporting study metadata' slots are used only when a more normalized model that leverages","        the 'supporting studdies' slot and 'Study' class to link to and describe the Study itself are not possible or preferred,","        such that this study metadata must be captured directly on the edge.","    abstract: true","","  supporting study method type:","    is_a: supporting study metadata","    description: \u003e-","      A type of method that was applied in a study used to generate the information used as evidence (e.g. a type of","      experimental assay, or statistical calculation, or computational analysis).","    range: uriorcurie","","  supporting study method description:","    is_a: supporting study metadata","    description: \u003e-","      A uri or curie pointing to information about the methodology used to generate data supporting an Association.","    range: uriorcurie","","  supporting study size:","    is_a: supporting study metadata","    description: \u003e-","      The sample size used in a study that provided evidence for the association (e.g. 'n' of a cohort for a","      clinical study).","    range: integer","","  supporting study cohort:","    is_a: supporting study metadata","    description: \u003e-","      A description of a study population/cohort that was interrogated to provide evidence for the association","      (e.g. the inclusion and exclusion criteria).","    range: string","","  supporting study date range:","    is_a: supporting study metadata","    description: \u003e-","      The date range over which data was collected in a study that provided evidence for an Association.","    range: string","","  supporting study context:","    is_a: supporting study metadata","    description: \u003e-","      A term or terms describing the experimental setting/context in which evidence supporting the Association was","      generated ('context' may be defined by many factors, including taxon, model system (e.g. cell line type), tissue","      type, disease, etc.).","    range: string","","  knowledge level:","    aliases: ['knowledge type']","    is_a: association slot","    description: \u003e-","      Describes the level of knowledge expressed in a statement, based on the","      reasoning or analysis methods used to generate the statement, or the","      scope or specificity of what the statement expresses to be true.","    notes: \u003e-","      The notion of a 'level' of knowledge can in one sense relate to the strength","      of a statement - i.e. how confident we are that it says something true about","      our domain of discourse. Here, we can generally consider Assertions to be","      stronger than Entailments to be stronger than Predictions.","      But in another sense, 'level' of knowledge can refer to the scope or specificity of","      what a statement expresses - on a spectrum from context-specific results of a data","      analysis, to generalized assertions of knowledge or fact. Here, Statistical","      Associations and  Observations represent more foundational statements that are only","      slightly removed from the data on which they are based (the former reporting the","      direct results of  an analysis in terms of correlations between variables in the data,","      and the latter describing phenomena that were observed/reported to have occurred).","    domain: association","    range: KnowledgeLevelEnum","    multivalued: false","    required: true","    examples:","      - value: knowledge_assertion","      - value: prediction","      - value: statistical_association","","  agent type:","    is_a: association slot","    description: \u003e-","        Describes the high-level category of agent who originally generated a","        statement of knowledge or other type of information.","    notes: \u003e-","        Note that this property indicates the type of agent who produced a","        final statement of knowledge, which is often different from the","        agent oragents who produced information used as evidence to","        support generation of this knowledge. For example, if a human curator","        concludes that a particular gene variant causes a medical condition -","        based on their interpretation of information produced by computational","        modeling tools, automated data analysis pipelines, and robotic laboratory","        assay systems - the agent_type for this statement is 'manual agent' -","        despite all of the evidence being created by automated agents. But if any","        of these systems is programmed to generate knowledge statements","        directly and without human assistance, the statement would be attributed","        to an 'automated_agent'.","    domain: association","    range: AgentTypeEnum","    multivalued: false","    required: true","    examples:","      - value: manual_agent","      - value: automated_agent","      - value: computational_model","      - value: text_mining_agent","","  has biological sex:","    description: The biological sex of the entity (e.g., male or female) regarding a case description from a phenopacket","    required: false","    range: biological sex","","classes:","  # Add the KGX-specific classes without modifying biolink classes","  KnowledgeGraph:","    description: A knowledge graph represented in KGX format","    slots:","      - nodes","      - edges","","  Node:","    description: A node in a KGX graph, will be superclass for named thing","","  Edge:","    description: An edge in a KGX graph, will be superclass for association","","","  knowledge graph:","    description: \u003e-","      A knowledge graph is a structured representation of knowledge in the form of a graph,","      where nodes represent entities or concepts, and edges represent relationships between them.","      Knowledge graphs are used to organize and connect information from various sources,","      enabling better understanding, analysis, and reasoning about complex domains.","    slots:","      - nodes","      - edges","    tree_root: true","    abstract: true","","  mapping collection:","    description: \u003e-","      A collection of deprecated mappings.","    abstract: true","    slots:","      - predicate mappings","    tree_root: true","","  predicate mapping:","    description: \u003e-","      A deprecated predicate mapping object contains the deprecated predicate and an example of the rewiring that should","      be done to use a qualified statement in its place.","    slots:","      - mapped predicate","      - subject aspect qualifier","      - subject direction qualifier","      - subject form or variant qualifier","      - subject part qualifier","      - subject derivative qualifier","      - subject context qualifier","      - predicate","      - qualified predicate","      - object aspect qualifier","      - object direction qualifier","      - object form or variant qualifier","      - object part qualifier","      - object derivative qualifier","      - object context qualifier","      - causal mechanism qualifier","      - anatomical context qualifier","      - species context qualifier","      - exact match","      - narrow match","      - broad match","","","   ## ----------","   ## ATTRIBUTES","   ## ----------","","   ## Ontology Classes","","  ontology class:","    mixin: true","    slots:","      - id","    description: \u003e-","      a concept or class in an ontology, vocabulary or thesaurus. Note that nodes in","      a biolink compatible KG can be considered both instances of biolink classes, and","      OWL classes in their own right. In general you should not need to use this class directly.","      Instead, use the appropriate biolink class. For example, for the GO concept of endocytosis (GO:0006897),","      use bl:BiologicalProcess as the type.","    exact_mappings:","      - owl:Class","      - schema:Class","    comments:","      - \u003e-","        This is modeled as a mixin. 'ontology class' should not be the primary type of a","        node in the KG. Instead you should use an informative bioloink category, such as AnatomicalEntity","        (for Uberon classes), ChemicalSubstance (for CHEBI or CHEMBL), etc","      - \u003e-","        Note that formally this is a metaclass. Instances of this class are instances in the graph,","        but can be the object of 'type' edges. For example, if we had a node in the graph representing","        a specific brain of a specific patient (e.g brain001), this could have a category of bl:Sample,","        and by typed more specifically with an ontology class UBERON:nnn, which has as category bl:AnatomicalEntity","    see_also:","      - https://github.com/biolink/biolink-model/issues/486","    examples:","      - value: UBERON:0000955","        description: \u003e-","          the class 'brain' from the Uberon anatomy ontology","    id_prefixes:","      - MESH","      - UMLS","      - KEGG.BRITE  ## br/ko number","","  annotation:","    description: \u003e-","      Biolink Model root class for entity annotations.","    abstract: true","","  quantity value:","    is_a: annotation","    description: \u003e-","      A value of an attribute that is quantitative and measurable,","      expressed as a combination of a unit and a numeric value","    slots:","      - has unit","      - has numeric value","","   # Alignment attempted of the biolink:Attribute model","   # to the proposed TRAPI Release 1.1 Attribute schema, i.e.","   #","   # attribute_name: \"assertionAuthoredBy\",","   # attribute_type: SEPIO:0000130,","   # value: \"ORCID:12345\",","   # value_type: \"wd:Q51044\",","   # value_type_name: \"ORCID ID\"","   # url: https://orcid.org/12345","   # source: ORCID","","  attribute:","    is_a: named thing","    mixins:","      - ontology class","    description: \u003e-","      A property or characteristic of an entity.","      For example, an apple may have properties such as color, shape, age, crispiness.","      An environmental sample may have attributes such as depth, lat, long, material.","    slots:","      - name                    # 'attribute_name'","      - has attribute type      # 'attribute_type'","       # 'value', 'value_type', 'value_type_name'","       # extracted from either of the next two slots","      - has quantitative value","      - has qualitative value","      - iri               