tion relationship between two taxa. This may be a symbiotic","      relationship (encompassing mutualism and parasitism), or it may be non-symbiotic.","      Example: plague transmitted_by flea; cattle domesticated_by Homo sapiens; plague infects Homo sapiens","    defining_slots:","      - predicate","    slots:","      - associated environmental context","    slot_usage:","      subject:","        range: organism taxon","        role: interactor taxon","        description: \u003e-","          the taxon that is the subject of the association","      object:","        range: organism taxon","        role: interactee taxon","        description: \u003e-","          the taxon that is the subject of the association","      predicate:","        subproperty_of: interacts with","      associated environmental context:","        description: \u003e-","          the environment in which the two taxa interact","","  organism taxon to environment association:","    is_a: association","    abstract: true","    mixins:","      - organism taxon to entity association","    slot_usage:","      subject:","        range: organism taxon","        role: interactor taxon","        description: \u003e-","          the taxon that is the subject of the association","      object:","        role: environmental context","        description: \u003e-","          the environment in which the organism occurs","      predicate:","        description: \u003e-","          predicate describing the relationship between the taxon and the environment","","","enums:","","  ResponseEnum:","    description: \u003e-","      A response to a treatment or intervention","    permissible_values:","      therapeutic_response:","        description: \u003e-","          A positive response to a treatment or intervention","      negative:","        description: \u003e-","          A negative response to a treatment or intervention","","  ResponseTargetEnum:","    description: \u003e-","      The target of a treatment or intervention","    permissible_values:","      cohort:","        description: \u003e-","          A group of individuals that are the target of a treatment or intervention","      cell line:","        description: \u003e-","          A cell line that is the target of a treatment or intervention","      individual:","        description: \u003e-","          An individual that is the target of a treatment or intervention","      sample:","        description: \u003e-","          A biological materialsample that is the target of a treatment or intervention","","  ClinicalTrialStatusEnum:","    description: \u003e","      Enumeration of clinical trial statuses indicating the recruitment state,","      availability, or regulatory status of a clinical study or intervention.","    permissible_values:","      ACTIVE_NOT_RECRUITING:","        description: The study is ongoing but not currently recruiting participants.","      APPROVED_FOR_MARKETING:","        description: The intervention has received regulatory approval for marketing.","      AVAILABLE:","        description: The intervention or data is available for use or distribution.","      COMPLETED:","        description: The study has ended normally and participants are no longer being examined or treated.","      ENROLLING_BY_INVITATION:","        description: Participants are being enrolled by invitation only.","      NO_LONGER_AVAILABLE:","        description: The intervention or data is no longer available.","      NOT_YET_RECRUITING:","        description: The study has not yet started recruiting participants.","      RECRUITING:","        description: The study is currently recruiting participants.","      SUSPENDED:","        description: The study has been temporarily halted but may resume.","      TEMPORARILY_NOT_AVAILABLE:","        description: The intervention or data is not currently available but may become available later.","      TERMINATED:","        description: The study has stopped prematurely and will not start again.","      UNKNOWN:","        description: The recruitment or availability status is unknown.","      WITHDRAWN:","        description: The study was halted before enrolling its first participant.","","  ApprovalStatusEnum:","    description: \u003e-","    permissible_values:","      \"discovery_and_development_phase\":","        description: \u003e-","          Discovery \u0026 Development Phase. Discovery involves researchers finding new possibilities","          for medication through testing molecular compounds, noting unexpected effects from existing treatments,","          or the creation of new technology that allows novel ways of targeting medical products to sites in the body.","          Drug development occurs after researchers identify potential compounds for experiments.","      \"preclinical_research_phase\":","        description: \u003e-","          Preclinical Research Phase.  Once researchers have examined the possibilities a new drug may contain,","          they must do preliminary research to determine its potential for harm (toxicity).","          This is categorized as preclinical research and can be one of two types: in vitro or in vivo.","      \"fda_clinical_research_phase\":","        description: \u003e-","          Clinical Research Phase. Clinical research involves trials of the drug on people,","          and it is one of the most involved stages in the drug development and approval process.","          Clinical trials must answer specific questions and follow a protocol determined by","          the drug researcher or manufacturer.","      \"fda_review_phase_4\":","        description: \u003e-","          FDA Review","      \"fda_post_market_safety_review\":","        description: \u003e-","          FDA Post-Market Safety Monitoring.  The last phase of drug approval is an ongoing one","          while the drug is on the marketplace. If a developer wants to change anything about the","          drug formulation or approve it for a new use, they must apply with the FDA. The FDA also","          frequently reviews the drug’s advertising and its manufacturing facility to make sure","          everything involved in its creation and marketing is in compliance with regulations.","      \"fda_clinical_research_phase_1\":","        description: \u003e-","          In the FDA Clinical Research Phase, the Clinical Research Phase 1 involves 20 – 100 study participants and","          lasts several months. This phase is used to determine the safety and dosage of the drug,","          and about 70% of these drugs move on to the next clinical research phase.","      \"fda_clinical_research_phase_2\":","        description: \u003e-","          In the FDA Clinical Research Phase, the Clinical Research Phase 2 involves up to several hundred people,","          who must have the disease or condition the drug supposes to treat. This phase can last","          from a few months to two years, and its purpose is to monitor the efficacy of the drug,","          as well as note side effects that may occur.","      \"fda_clinical_research_phase_3\":","        description: \u003e-","          In the FDA Clinical Research Phase, the Clinical Research Phase 3 involves 300 – 3000 volunteers","          and can last up to four years. It is used to continue monitoring the efficacy of","          the drug, as well as exploring any longer-term adverse reactions.","      \"fda_clinical_research_phase_4\":","        description: \u003e-","          In the FDA Clinical Research Phase, the Clinical Research Phase 4 involves several thousands of","          volunteers who have the disease or condition and continues to monitor safety and efficacy.","          If a drug passes this phase, it goes on to FDA review.","      \"fda_fast_track\":","        description: \u003e-","          Fast track is a process designed to facilitate the development, and expedite the","          review of drugs to treat serious conditions and fill an unmet medical need.","          The purpose is to get important new drugs to the patient earlier. Fast Track","          addresses a broad range of serious conditions. For more information https://www.fda.gov/patients/fast-track-breakthrough-therapy-accelerated-approval-priority-review/fast-track","      \"fda_breakthrough_therapy\":","        description: \u003e-","          Breakthrough Therapy designation is a process designed to expedite the","          development and review of drugs that are intended to treat a serious","          condition and preliminary clinical evidence indicates that the drug may","          demonstrate substantial improvement over available therapy on a clinically significant endpoint(s).","          For more information https://www.fda.gov/patients/fast-track-breakthrough-therapy-accelerated-approval-priority-review/breakthrough-therapy","      \"fda_accelerated_approval\":","        description: \u003e-","          When studying a new drug, it can sometimes take many years to learn whether a drug actually","          provides a real effect on how a patient survives, feels, or functions. A positive therapeutic","          effect that is clinically meaningful in the context of a given disease is known as “clinical benefit”.","          Mindful of the fact that it may take an extended period of time to measure a drug’s intended clinical","          benefit, in 1992 FDA instituted the Accelerated Approval regulations. These regulations allowed drugs","          for serious conditions that filled an unmet medical need to be approved based on a surrogate endpoint.","          Using a surrogate endpoint enabled the FDA to approve these drugs faster.","          For more information https://www.fda.gov/patients/fast-track-breakthrough-therapy-accelerated-approval-priority-review/accelerated-approval","      \"fda_priority_review\":","        description: \u003e-","          Prior to approval, each drug marketed in the United States must go through a detailed FDA review process.","          In 1992, under the Prescription Drug User Act (PDUFA), FDA agreed to specific goals for improving","          the drug review time and created a two-tiered system of review times – Standard Review and Priority","          Review. A Priority Review designation means FDA’s goal is to take action on an application","          within 6 months (compared to 10 months under standard review).","          For more information https://www.fda.gov/patients/fast-track-breakthrough-therapy-accelerated-approval-priority-review/priority-review","      \"regular_fda_approval\":","        description: \u003e-","          Regular FDA Approval.  The last phase of drug approval is an ongoing one while the drug is on the marketplace.","          If a developer wants to change anything about the drug formulation or approve it for a new use,","          they must apply with the FDA. The FDA also frequently reviews the drug’s advertising and its","          manufacturing facility to make sure everything involved in its creation and marketing is in compliance","          with regulations.","      \"post_approval_withdrawal\":","","  ClinicalApprovalStatusEnum:","    description:","    permissible_values:","      approved_for_condition:","      fda_approved_for_condition:","        is_a: approved_for_condition","      not_approved_for_condition:","      post_approval_withdrawal:","        is_a: not_approved_for_condition","      off_label_use:","        is_a: not_approved_for_condition","      not_provided:","","  ResearchPhaseEnum:","    permissible_values:","      pre_clinical_research_phase:","        description: \u003e-","          Biolink 'pre_clinical_research' is the union of both the `FDA discovery and development phase` and","          `FDA preclinical research phase`. Discovery involves researchers finding new possibilities for medication","          through testing molecular compounds, noting unexpected effects from existing treatments, or the creation of","          new technology that allows novel ways of targeting medical products to sites in the body. Drug development","          occurs after researchers identify potential compounds for experiments Preclinical Research Phase.","          Once researchers have examined the possibilities a new drug may contain, they must do preliminary research","          to determine its potential for harm (toxicity). This is categorized as preclinical research and can be one of","          two types: in vitro or in vivo.","        notes: \u003e-","          DrugBank calls this 'experimental'.","      clinical_trial_phase:","        description: \u003e-","          Clinical research involves trials of the drug on people,","          and it is one of the most involved stages in the drug development and approval process.","          Clinical trials must answer specific questions and follow a protocol determined by","          the drug researcher or manufacturer.","      clinical_trial_phase_1:","        is_a: clinical_trial_phase","        description: \u003e-","          In the FDA Clinical Trial Phase, the Clinical Trial Phase 1 involves 20 – 100 study participants and","          lasts several months. This phase is used to determine the safety and dosage of the drug,","          and about 70% of these drugs move on to the next clinical research phase.","      clinical_trial_phase_1_to_2:","        is_a: clinical_trial_phase","        description: \u003e-","          A study that tests the safety, side effects, and best dose of a new treatment. Phase I/II","          clinical trials also test how well a certain type of cancer or other disease responds to a","          new treatment. In the phase II part of the clinical trial, patients usually receive the","          highest dose of treatment that did not cause harmful side effects in the phase I part of","          the clinical trial. Combining phases I and II may allow research questions to be answered","          more quickly or with fewer patients. Also called phase 1/phase 2 clinical trial.","        see_also:","          - https://www.cancer.gov/publications/dictionaries/cancer-terms/def/phase-i-ii-clinical-trial","      clinical_trial_phase_2:","        is_a: clinical_trial_phase","        description: \u003e-","          In the FDA Clinical Trial Phase, the Clinical Trial Phase 2 involves up to several hundred people,","          who must have the disease or condition the drug supposes to treat. This phase can last","          from a few months to two years, and its purpose is to monitor the efficacy of the drug,","          as well as note side effects that may occur.","      clinical_trial_phase_2_to_3:","        is_a: clinical_trial_phase","        description: \u003e-","          A study that tests how well a new treatment works for a certain type of cancer or other","          disease and compares the new treatment with a standard treatment. Phase II/III clinical","          trials may also provide more information about the safety and side effects of the new","          treatment. Combining phases II and III may allow research questions to be answered more","          quickly or with fewer patients. Also called phase 2/phase 3 clinical trial.","        see_also:","          - https://www.cancer.gov/publications/dictionaries/cancer-terms/def/phase-ii-iii-clinical-trial","      clinical_trial_phase_3:","        is_a: clinical_trial_phase","        description: \u003e-","          In the FDA Clinical Trial Phase, the Clinical Trial Phase 3 involves 300 – 3000 volunteers","          and can last up to four years. It is used to continue monitoring the efficacy of","          the drug, as well as exploring any longer-term adverse reactions.","      clinical_trial_phase_4:","        is_a: clinical_trial_phase","        description: \u003e-","          In the FDA Clinical Trial Phase, the Clinical Trial Phase 4 involves several thousan