nhibition","        description: \u003e-","          A causal mechanism in which an antibody specifically binds to and interferes with the target.","      antagonism:","        is_a: inhibition","        description: \u003e-","          A causal mechanism in which the effector binds to a receptor and prevents activation by an agonist","          through competing for the binding site.","        close_mappings:","          - DGIdb:antagonist","          - CHEMBL.MECHANISM:antagonist","        narrow_mappings:","          - CHEMBL.MECHANISM:allosteric_antagonist","      molecular_channel_blockage:","        is_a: inhibition","        description: \u003e-","          A causal mechanism in which the effector binds to a molecular channel and prevents or reduces","          transport of ions through it.","      inverse_agonism:","        is_a: inhibition","        description: \u003e-","          A causal mechanism in which the effector binds to the same receptor-binding site as an agonist and antagonizes","          its effects, often exerting the opposite effect of the agonist by suppressing spontaneous receptor signaling.","        close_mappings:","          - CHEMBL.MECHANISM:inverse_agonist","          - DGIdb:inverse_agonist","      negative_allosteric_modulation:","        is_a: inhibition","        description: \u003e-","          A causal mechanism in which the effector reduces or prevents the action of the endogenous ligand of a","          receptor by binding to a site distinct from that ligand (i.e. non-competitive inhibition)","        close_mappings:","          - CHEMBL.MECHANISM:negative_allosteric_modulator","          - DGIdb:inhibitory_allosteric_modulator","        narrow_mappings:","          - DGIdb:negative_modulator","      agonism:","        is_a: activation","        description: \u003e-","          A causal mechanism in which the effector binds and activates a receptor to mimic the effect of an","          endogenous ligand.","        close_mappings:","          - CHEMBL.MECHANISM:agonist","          - DGIdb:agonist","        narrow_mappings:","          - CHEMBL.MECHANISM:partial_agonist","          - DGIdb:partial_agonist","      molecular_channel_opening:","        is_a: activation","        description: \u003e-","          A causal mechanism in which the effector binds to a molecular channel and facilitates transport of","          ions through it.","        close_mappings:","          - CHEMBL.MECHANISM:opener","      positive_allosteric_modulation:","        is_a: activation","        description: \u003e-","          A causal mechanism in which the effector enhances the action of the endogenous ligand of a receptor by","          binding to a site distinct from that ligand (i.e. non-competitive inhibition)","        close_mappings:","          - CHEMBL.MECHANISM:positive_allosteric_modulator","          - CHEMBL.MECHANISM:positive_modulator","          - DGIdb:positive_allosteric_modulator","        broad_mappings:","          - DGIdb:modulator","          - DGIdb:allosteric_modulator","      potentiation:","        is_a: binding","        description: \u003e-","          A causal mechanism in which the effector  binds to and enhances or intensifies the effect of some","          other chemical or drug on its target.","        close_mappings:","      activation:","        is_a: binding","        description: \u003e-","          A causal mechanism in which the effector binds to and positively affects the normal functioning of its target.","        close_mappings:","          - CHEMBL.MECHANISM:activator","          - DGIdb:activator","      inducer:","        is_a: binding","        description: \u003e-","          A causal mechanism in which the effector binds to and increases the activity/rate of an enzyme that","          processes drugs in the body.","        close_mappings:","          - DGIdb:inducer","      transcriptional_regulation:","        description: \u003e-","          A causal mechanism mediated by through the control of target gene transcription","      signaling_mediated_control:","        description: \u003e-","          A causal mechanism mediated by the activation or control of signaling events that influence the some aspect","          of the target entity (e.g. its activity, processing, transport, etc)","      stabilization:","        is_a: activation","        close_mappings:","          - CHEMBL.MECHANISM:stabiliser","      stimulation:","        is_a: activation","        close_mappings:","          - DGIdb:stimulator","          - SEMMEDDB:STIMULATES","          - DGIdb:stimulator","      releasing_activity:","        is_a: activation","        close_mappings:","          - CHEMBL:MECHANISM:releasing_agent","","  LogicalInterpretationEnum:","    permissible_values:","      some_some:","        description: \u003e-","          A modifier on a triple that causes the triple to be interpreted as a some-some statement","        meaning: os:SomeSomeInterpretation","      all_some:","        description: \u003e-","          A modifier on a triple that causes the triple to be interpreted as an all-some statement.","        meaning: os:AllSomeInterpretation","      inverse_all_some:","","  ReactionDirectionEnum:","    permissible_values:","      left_to_right:","      right_to_left:","      bidirectional:","      neutral:","","  ReactionSideEnum:","    permissible_values:","      left:","      right:","","  PhaseEnum:","    description: phase","    permissible_values:","      0:","      1:","      2:","","  StrandEnum:","    description: strand","    permissible_values:","      \"+\":","        description: Positive","      \"-\":","        description: Negative","      \".\":","        description: Unstranded","      \"?\":","        description: Unknown","","  SequenceEnum:","    description: type of sequence","    permissible_values:","      \"na\":","        description: nucleic acid","      \"aa\":","        description: amino acid","","  DruggableGeneCategoryEnum:","    permissible_values:","      \"tclin\":","        description: \u003e-","          These targets have activities in DrugCentral (ie. approved drugs) with known mechanism of action.","      \"tbio\":","        description: \u003e-","          These targets have activities in ChEMBL, Guide to Pharmacology or DrugCentral that satisfy","          the activity thresholds detailed below.","      \"tchem\":","        description: \u003e-","          These targets do not have known drug or small molecule activities that satisfy the activity","          thresholds detailed below AND satisfy one or more of the following criteria:","          target is above the cutoff criteria for Tdark","          target is annotated with a Gene Ontology Molecular Function or Biological Process leaf term(s)","          with an Experimental Evidence code","      \"tdark\":","        description: \u003e-","          These are targets about which virtually nothing is known. They do not have known drug or small","          molecule activities that satisfy the activity thresholds detailed below AND satisfy two or","          more of the following criteria:","          A PubMed text-mining score from Jensen Lab less than 5, greater than or equal TO 3 Gene RIFs, or","          less than or equal to 50 Antibodies available according to http://antibodypedia.com.","","  DrugAvailabilityEnum:","    description: \u003e-","    permissible_values:","      \"over_the_counter\":","        description: \u003e-","          chemical entity is available over the counter without a prescription.","      \"prescription\":","        description:","          chemical entity is available by prescription.","","  DrugDeliveryEnum:","    permissible_values:","      \"inhalation\":","      \"oral\":","      \"absorption_through_the_skin\":","      \"intravenous_injection\":","","  ResourceRoleEnum:","    description: \u003e-","      The role played by the information reource in serving as a","      source for an edge in a TRAPI message. Note that a given Edge should have one","      and only one 'primary' source, and may have any number of","      'aggregator' or 'supporting data' sources.  This enumeration","      is found in Biolink Model, but is repeated here for convenience.","    permissible_values:","      \"primary_knowledge_source\":","      \"aggregator_knowledge_source\":","      \"supporting_data_source\":","    in_subset:","      - translator_minimal","","  AffinityParameterEnum:","    description: \u003e-","      The types of parameters that can be used to describe the affinity between two entities, characteristically chemicals and proteins.","    permissible_values:","      \"pIC50\":","        description: \u003e-","          Negative logarithm of the molar concentration of a chemical that produces a 50% inhibition of a function","      \"pEC50\":","        description: \u003e-","          Negative logarithm of the molar concentration of a chemical that produces a 50% excitation of a function","      \"pAC50\":","      \"pXC50\":","      \"pKi\":","      \"pKd\":","","  FDAIDAAdverseEventEnum:","    description: \u003e-","      please consult with the FDA guidelines as proposed in this document:","      https://www.accessdata.fda.gov/scripts/cdrh/cfdocs/cfcfr/cfrsearch.cfm?fr=312.32","    permissible_values:","      \"life_threatening_adverse_event\":","        description: \u003e-","          An adverse event or suspected adverse reaction is considered 'life-threatening' if, in the view of either","          the investigator or sponsor, its occurrence places the patient or subject at immediate risk of death.","          It does not include an adverse event or suspected adverse reaction that, had it occurred in a more","          severe form, might have caused death.","      \"serious_adverse_event\":","        description: \u003e-","          An adverse event or suspected adverse reaction is considered 'serious' if, in the view of either the","          investigator or sponsor, it results in any of the following outcomes: Death, a life-threatening adverse event,","          inpatient hospitalization or prolongation of existing hospitalization, a persistent or significant incapacity","          or substantial disruption of the ability to conduct normal life functions, or a congenital anomaly/birth","          defect. Important medical events that may not result in death, be life-threatening, or require hospitalization","          may be considered serious when, based upon appropriate medical judgment, they may jeopardize the patient or","          subject and may require medical or surgical intervention to prevent one of the outcomes listed in this","          definition. Examples of such medical events include allergic bronchospasm requiring intensive treatment","          in an emergency room or at home, blood dyscrasias or convulsions that do not result in inpatient","          hospitalization, or the development of drug dependency or drug abuse.","      \"suspected_adverse_reaction\":","        description: \u003e-","           means any adverse event for which there is a reasonable possibility that the drug caused the adverse event.","           For the purposes of IND safety reporting, 'reasonable possibility' means there is evidence to suggest a","           causal relationship between the drug and the adverse event. Suspected adverse reaction implies a lesser","           degree of certainty about causality than adverse reaction, which means any adverse event caused by a drug.","      \"unexpected_adverse_event\":","        description: \u003e-","          An adverse event or suspected adverse reaction is considered 'unexpected' if it is not listed in the","          investigator brochure or is not listed at the specificity or severity that has been observed; or, if an","          investigator brochure is not required or available, is not consistent with the risk information described","          in the general investigational plan or elsewhere in the current application, as amended. For example,","          under this definition, hepatic necrosis would be unexpected (by virtue of greater severity) if the","          investigator brochure referred only to elevated hepatic enzymes or hepatitis. Similarly, cerebral","          thromboembolism and cerebral vasculitis would be unexpected (by virtue of greater specificity) if the","          investigator brochure listed only cerebral vascular accidents. 'Unexpected', as used in this definition,","          also refers to adverse events or suspected adverse reactions that are mentioned in the investigator brochure","          as occurring with a class of drugs or as anticipated from the pharmacological properties of the drug, but","          are not specifically mentioned as occurring with the particular drug under investigation.","    in_subset:","      - translator_minimal","","  AgentTypeEnum:","    permissible_values:","      manual_agent:","        description: \u003e-","          A human agent who is responsible for generating a statement of","          knowledge. The human may utilize computationally generated","          information as evidence for the resulting knowledge,","          but the human is the one who ultimately interprets/reasons with","          this evidence to produce a statement of knowledge.","      automated_agent:","        description: \u003e-","          An automated agent, typically a software program or tool, that is","          responsible for generating a statement of knowledge. Human contribution","          to the knowledge creation process ends with the definition and coding","          of algorithms or analysis pipelines that get executed by the automated","          agent.","      data_analysis_pipeline:","        is_a: automated_agent","        description: \u003e-","          An automated agent that executes an analysis workflow over data and","          reports the direct results of the analysis. These typically report","          statistical associations/correlations between variables in the input","          dataset, and do not interpret/infer broader conclusions from associations","          the analysis reveals in the data.","        notes: \u003e-","          If an analysis pipeline includes any rules for generating broader","          conclusions based on the dataset-specific statistical correlations","          it calculates (e.g. create a 'treats' edge when the analysis reveals a","          drug-disease correlation in the data with statistical scores that meet a","          certain threshold) - we would consider this agent to be a Computational Model","          rather than just a Data Analysis Pipeline.","      computational_model:","        is_a: automated_agent","        description: \u003e-","          An automated agent that generates knowledge statements (typically","          predictions) based on rules/logic explicitly encoded in an algorithm","          (e.g. heuristic models, supervised classifiers), or learned from patterns","          observed in data (e.g. ML models, unsupervised classifiers).","        notes: \u003e-","          The bar is quite low relatively for what is considered to be a","          ‘computational model’ by our definition. Even agents/tools that apply","          simple rules or logic to the output of an ingest or analysis pipeline","          to allow for a stronger or more general conclusion to be stated can","          qualify an agent as a model. For example, an ingest pipeline that applies rules to its ingest of","          clinical trials data to create a 'treats' prediction edge when the","          source reports a drug to be in phase 2 or 3 trials represents a","          computational model because it is automatically drawing a stronger","          conclusion than the source reports, based on logic encoded in the ingest","          pipeline. Similarly, a data analysis pipeline that is extended with rules to","          automatically generate broader conclusions based on dataset-specific","          statistical correlations (e.g. create a 'treats' edge when the analysis","          reveals a drug-disease correlation in the data with statistical scores","          that meet a certain threshold), would also qualify as a computational","          model by our definition.","      text_mining_agent:","        is_a: automated_agent","        description: \u003e-","          An automated agent that uses Natural Language Processing to recognize","          concepts and/or relationships in text, and report them using formally","          encoded semantics (e.g. as an edge in a knowledge graph).","        notes: \u003e-","          The original statement in the source text is typically made by a human /","          manual agent, but if a specific encoding of this knowledge is produced","          by a text-mining tool, it has an agent_type of 'text_mining_agent'.","          Examples of text mining agents include SemmedDB, and the Translator","          Text-Mining Knowledge Provider. Note that text-mining tools are prone to erroneous interpretation of","          concepts and relationships, and can fail to provide important details","          about the context in which the original knowledge was reported - so","          users should always consult the source text for a text-mined statement","          to assess its veracity and relevance.","      image_processing_agent:","        is_a: automated_agent","        description: \u003e-","          An automated agent that processes images to generate textual statements of","          knowledge derived from the image and/or expressed in text the image","          depicts (e.g. via OCR).","      manual_validation_of_automated_agent:","        description: \u003e-","          A human agent reviews and validates/approves the veracity of knowledge","          that is initially generated by an automated agent.","        notes: \u003e-","          This term applies when a human was only involved in evaluating the veracity","          of a knowledge statement that was generated by an automated agent. It is","          important to indicate when such manual review has occurred, because it can","          give a user more confidence in an automated statement.","      not_provided:","        description: \u003e-","          The agent type is not provided, typically because it cannot be determined","          from available information if the agent that generated the knowledge is","          manual or automated.","    in_subset:","      - translator_minimal","","  KnowledgeLevelEnum:","    permissible_values:","      knowledge_assertion:","        aliases: ['assertion']","        description: \u003e-","          A statement of purported fact that is put forth by an agent as true,","          based on assessment of direct evidence. Assertions are likely but not","          definitively true.","        notes: \u003e-","          Knowledge Assertions are supported by direct evidence deemed sufficient","          by some agent to support a confidence assertion of truth. Our certainty","          in this truth is not absolute, but is typically higher than for Predictions.","      logical_entailment:","        aliases: ['deductive_inference']","        description: \u003e-","          A statement reporting a conclusion that follows logically from premises","          representing established facts or knowledge assertions (e.g. fingernail","          part of finger, finger part of hand --\u003e fingernail part of hand).","        notes: \u003e-","          These statements report entailed conclusions derived through dedictive inference.","          They are not directly asserted by a source, but logically follow from statement(s)","          a source does make - and are necessarily true if their supporting premises are true.","          In practice, these will primarily be entailments based on logic encoded in ontologies.","          Examples include propagation of annotated knowledge to hierarchically-related concepts,","          across paths through a graph constructed from transitive relationships, or sets of","          relationships that support property chain inference.","      prediction:","        aliases: ['hypothesis']","        description: \u003e-","          A statement of a possible fact based on probabilistic forms of reasoning over","          more indirect forms of evidence, that lead to more speculative conclusions.","        notes: \u003e-","          Predictions typically result from non-deductive forms of reasoning - e.g.","          inductive and deductive inference, or statistical inference where conclusions","          are drawn about a broader/global population based on data from a representative","          cohort. For example, a prediction that a drug may treat a particular disease based on its chemical","          similarity to known drugs that treat the disease, and the fact that it can inhibit proteins","          in a pathway that is associated with the disease","          As Predictions are based on weaker forms of inference and evidence, they are typically","          considered lower confidence statements as compared to Knowledge Assertions and Logical","          Entailments.","      statistical_association:","        description: \u003e-","          A statement that reports concepts representing variables in a dataset to be statistically","          associated with each other in a particular cohort (e.g. 'Metformin Treatment (variable 1)","          is correlated with Diabetes Diagnosis (variable 2) in EHR dataset X').","        notes: \u003e-","          Such statements report the direct results of some statistical analysis. Their scope is limited","          tp the cohort/dataset interrogated in the analysis, and they do not make broader claims or draw","          more meaningful conclusions about the domain of discourse. Note however that such Statistical","          Associations can be used as evidence to support a more pointed/precise Prediction or Assertion","          of knowledge. For example, e.g. a Statistical Association between 'Metformin Prescription' and","          'Diabetes Diagnosis' in EHR records could support a Prediction that 'Metformin treats Diabetes',","          or 'Metformin causes Diabetes'. This 'treats' edge may have a knowledge_level of 'Prediction',","          but the provider could use the 'evidence_type' edge property to indicate that this prediction is","          based on a 'Statistical Association'. Because Statistical Associations directly report analysis-specific","          results, we can consider them to be inherently true statements, whose broader utility is dependent on","          subsequent generalization of the reported result to a broader population, and/or interpretation of the","          result as support for a more meaningful statements about the domain of discourse.","      observation:","        description: \u003e-","          A statement reporting (and possibly quantifying) a phenomenon that was observed to occur -","          absent any analysis or interpretation that generates a statistical association or supports","          a broader conclusion or inference.","        notes: \u003e-","          An observation that \"56362 people self-reported taking melatonin to treat migraines\"","          is agnostic to whether melatonin is an effective or approved treatment - it only claims that it was","          taken for this purpose. Such observations, however, may be used as the basis for predicting that a","          drug may be efficacious against a disease.","      not_provided:","        description: \u003e-","          The knowledge level is not provided, typically because it cannot be determined from available.","          information.","        notes: \u003e-","          This term is most often applied for text-mined edges, as NLP tools are typically not able to detect","          a specific knowledge level for the concept relationships they extract (e.g. whether the author","          was predicting or asserting a relationship, or merely observed it to occur).","    in_subset:","      - translator_minimal"],"stylingDirectives":[[],[[0,2,"pl-ent"],[4,42,"pl-s"]],[[0,4,"pl-ent"],[6,19,"pl-s"]],[[0,11,"pl-ent"],[13,81,"pl-s"]],[[0,7,"pl-ent"],[9,59,"pl-s"]],[],[[0,72,"pl-c"],[0,1,"pl-c"]],[],[[0,7,"pl-ent"],[9,14,"pl-s"]],[],[[0,15,"pl-c"],[0,1,"pl-c"]],[[0,2,"pl-c"],[0,1,"pl-c"]],[[0,11,"pl-c"],[0,1,"pl-c"]],[[0,15,"pl-c"],[0,1,"pl-c"]],[[0,113,"pl-c"],[0,1,"pl-c"]],[[0,111,"pl-c"],[0,1,"pl-c"]],[[0,105,"pl-c"],[0,1,"pl-c"]],[[0,105,"pl-c"],[0,1,"pl-c"]],[[0,66,"pl-c"],[0,1,"pl-c"]],[[0,1,"pl-c"],[0,1,"pl-c"]],[[0,81,"pl-c"],[0,1,"pl-c"]],[[0,1,"pl-c"],[0,1,"pl-c"]],[[0,8,"pl-ent"]],[[2,7,"pl-ent"],[9,42,"pl-s"],[9,10,"pl-pds"],[41,42,"pl-pds"]],[[2,8,"pl-ent"],[10,42,"pl-s"],[10,11,"pl-pds"],[41,42,"pl-pds"]],[[2,7,"pl-ent"],[9,66,"pl-s"],[9,10,"pl-pds"],[65,66,"pl-pds"]],[[2,9,"pl-ent"],[11,44,"pl-s"],[11,12,"pl-pds"],[43,44,"pl-pds"]],[[2,12,"pl-ent"],[14,39,"pl-s"],[14,15,"pl-pds"],[38,39,"pl-pds"]],[[2,8,"pl-ent"],[10,36,"pl-s"],[10,11,"pl-pds"],[35,36,"pl-pds"]],[[2,6,"pl-ent"],[8,97,"pl-s"],[8,9,"pl-pds"],[96,97,"pl-pds"]],[[3,48,"pl-c"],[3,4,"pl-c"]],[[2,7,"pl-ent"],[9,38,"pl-s"],[9,10,"pl-pds"],[37,38,"pl-pds"]],[[3,76,"pl-c"],[3,4,"pl-c"]],[[2,10,"pl-ent"],[12,81,"pl-s"],[12,13,"pl-pds"],[80,81,"pl-pds"]],[[2,18,"pl-ent"],[20,69,"pl-s"],[20,21,"pl-pds"],[68,69,"pl-pds"]],[[2,5,"pl-ent"],[7,50,"pl-s"],[7,8,"pl-pds"],[49,50,"pl-pds"]],[[2,9,"pl-ent"],[11,43,"pl-s"],[11,12,"pl-pds"],[42,43,"pl-pds"]],[[2,15,"pl-ent"],[17,54,"pl-s"],[17,18,"pl-pds"],[53,54,"pl-pds"]],[[2,5,"pl-ent"],[7,59,"pl-s"],[7,8,"pl-pds"],[58,59,"pl-pds"]],[[2,15,"pl-ent"],[17,63,"pl-s"],[17,18,"pl-pds"],[62,63,"pl-pds"]],[[2,5,"pl-ent"],[7,58,"pl-s"],[7,8,"pl-pds"],[57,58,"pl-pds"]],[